graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Attribute Access</b></font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="apiKey__key" align="left" balign="left">apiKey</td><td port="apiKey__value" align="left" balign="left">secret123</td></tr><tr><td port="environment__key" align="left" balign="left">environment</td><td port="environment__value" align="left" balign="left">prod</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_dataProcessing {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>dataProcessing</b> <i>&lt;process&gt;</i></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "dataProcessing" [label=<<table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="dataSource__key" align="left" balign="left">dataSource</td><td port="dataSource__value" align="left" balign="left">postgres</td></tr><tr><td port="retries__key" align="left" balign="left">retries : number</td><td port="retries__value" align="left" balign="left">3</td></tr></table>>, shape=plain, margin=0];
    "dataProcessing__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    "fetchData" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>fetchData</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Fetch from {{ source }} with timeout {{<br/>timeout }}s</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="key__key" align="left" balign="left">key</td><td port="key__value" align="left" balign="left">{{ machine.apiKey }}</td></tr><tr><td port="source__key" align="left" balign="left">source</td><td port="source__value" align="left" balign="left">{{ dataProcessing.dataSource<br align="left"/>}}</td></tr><tr><td port="timeout__key" align="left" balign="left">timeout : number</td><td port="timeout__value" align="left" balign="left">30</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  }


  // Inferred Dependencies
  "fetchData" -> "dataProcessing" [label="reads source", style=dashed, color=blue];
}
